import React from 'react';

function ContactCard(props) {
    return(
        <div>
            <h2>Name: {props.name}</h2>
            <h4>Phone: {props.phone}</h4>
            <h4>Email: {props.name}</h4>
        </div>
    );
}
export default ContactCard;
